import axios from "axios";

const apiUrl = "https://jadwalku-app.herokuapp.com/";

export const fetchListByDate = (data) => {
    return (dispatch) => {   
        return axios
            .get(`${apiUrl}trips/find/${data.destination}`, {})
            .then((response) => {
                dispatch(fetchListByDateSukses(response.data.data)); 
            })
            .catch((error) => {
                throw error;
            });
    };
};

export const fetchListByDateSukses = (data) => {
    return {
        type: "SET_SEARCH",
        payload: {
            data,
        },
    };
};
